// HomePage.js
import React from "react";
import Header from "../../components/ui/header/header";
import Footer from "../../components/ui/footer/footer";
import Sidebar from "./sidebar/sideBar";
function HomePage() {
  return (
    <div>
      <Header />
      <Sidebar />

      <Footer />
    </div>
  );
}

export default HomePage;
